        </div>
        <ul>
            <div>{message}</div>
            <div>{boardList}</div>
        </ul>
        <Navbar />
            <Routes>
                <Route path="/" exact element={<MainPage />} />
                <Route path="/about" element={<About />} />
                <Route path="/board/list" element={<BoardList />} />
                <Route path="/login" element={<LoginForm />} />
                <Route path="/create" element={<CreateForm />} />
            </Routes>
        <Footer />

    </>
    );
}

export default App;
